package net.kiev.web.model;public class ValueDto {    private String valueA;    private String valueB;    private String valueC;    public String getValueA() {        return valueA;    }    public void setValueA(String valueA) {        this.valueA = valueA;    }    public String getValueB() {        return valueB;    }    public void setValueB(String valueB) {        this.valueB = valueB;    }    public String getValueC() {        return valueC;    }    public void setValueC(String valueC) {        this.valueC = valueC;    }    @Override    public String toString() {        return "NotificationDto{" +                "valueA='" + valueA + '\'' +                ", valueB='" + valueB + '\'' +                ", valueC='" + valueC + '\'' +                '}';    }}